const Botones = ({ setCount, good }) => {
return (
<div>
<button onClick={() => setGood(good + 1)}>Increment</button>
<button onClick={() => (good > 0 ? setGood(good - 1) : setGood(0))}>
Decrement
</button>
</div>
);
};
export default Botones;
